import SearchBar from './searchBar/SearchBar';
import './nav.css';
import { Link } from 'react-router-dom';
import About from '../about/About';

const Nav = ({ onSearch }) => {
    
    return ( 
        <div>
      <Link to='/about'>
        <button>About</button>
      </Link>
      <Link to="/home">
        <button>Home</button>
      </Link>
            <SearchBar onSearch={(characterID) => window.alert(characterID)} />
        </div>
    )
}

export default Nav;
